import { Injectable } from '@angular/core';
import { ComplicationThoraciqueAigu } from '../models/ComplicationThoraciqueAigu';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class ThoraciqueService {

  private apiUrl = 'https://localhost:7129/api/ComplicationThoraciqueAigus';

  constructor(private http: HttpClient) { }
  addthoracique(ComplicationThoraciqueAigu: ComplicationThoraciqueAigu): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationThoraciqueAigu);

    return this.http.post<any>(`${this.apiUrl}/addthoracique`, ComplicationThoraciqueAigu, { observe: 'response' });
  }}
